(6, 6, 'ar', 'كفالة اليتيمة نورة', 'كفالة-اليتيمة-نورة', '<p dir=\"rtl\"><strong>نسعى للمساهمة في رعاية الأيتام وتوفير احتياجاتهم الأساسية وتلبية متطلباتهم&nbsp;</strong></p>\r\n\r\n<p dir=\"rtl\"><strong>( انا وكافل اليتيم كهاتين في الجنة)&nbsp;</strong></p>\r\n\r\n<p dir=\"rtl\"><strong>وكفالة يتيم مكة الذي هو يتيم الحرم تأتي في المرتبة الأولى حيث الحرم المكي ومضاعفة الأجر -</strong></p>\r\n\r\n<p><strong>تقدم هذه الكفالة مساعدة مالية شهرية لأيتام مكة المكرمة تسدّ شيئاً من احتياجهم.<br />\r\n<br />\r\nكفالة يتيم كل شهر 300&nbsp; ريال </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>الحساب البنكي&nbsp;</strong></p>\r\n\r\n<p><strong>مصرف الراجحي&nbsp;</strong></p>\r\n\r\n<p><strong>SA8280000324608010436144</strong></p>', NULL, NULL, NULL, NULL, '2025-08-20 10:19:48', '2025-08-20 10:19:48');
