(703, 703, 'ar', 'أهمية الحوكمة:', '<ul>\r\n	<li>تعزيز ثقة المستثمرين: تساهم الحوكمة الجيدة في بناء ثقة للمستثمرين وجذب رؤوس الأموال.</li>\r\n	<li>تحسين الأداء المالي: الشركات ذات الحوكمة القوية تميل إلى تحقيق أداء مالي أفضل على المدى الطويل.</li>\r\n	<li>تقليل مخاطر الاحتيال والفساد: تساهم في وضع ضوابط داخلية قوية تمنع الممارسات غير الأخلاقية.</li>\r\n	<li>تعزيز سمعة الشركة: تساهم في بناء سمعة طيبة للشركة وتعزيز علاقاتها مع الأطراف ذات المصلحة.</li>\r\n	<li>تحقيق الاستدامة والنمو طويل الأجل: تساعد في اتخاذ قرارات مسؤولة تضمن استدامة الشركة على المدى الطويل.</li>\r\n</ul>\r\n\r\n<h2>السياسات</h2>\r\n\r\n<ul>\r\n	<li>\r\n	<p><a href=\"policies/risk-management.pdf\"><img alt=\"\" src=\"img/pdf.png\" />سياسة إدارة المخاطر</a></p>\r\n	</li>\r\n	<li>\r\n	<p><a href=\"policies/whistleblower.pdf\"><img alt=\"\" src=\"img/pdf.png\" />سياسة الإبلاغ عن المخالفات وحماية مقدمي البلاغات</a></p>\r\n	</li>\r\n	<li>\r\n	<p><a href=\"policies/document-retention.pdf\"><img alt=\"\" src=\"img/pdf.png\" />سياسة الاحتفاظ بالوثائق وإتلافها</a></p>\r\n	</li>\r\n	<li>\r\n	<p><a href=\"policies/donation-policy.pdf\"><img alt=\"\" src=\"img/pdf.png\" />سياسة الاستبدال والإرجاع الخاصة بالتبرعات</a></p>\r\n	</li>\r\n	<li>\r\n	<p><a href=\"policies/investment.pdf\"><img alt=\"\" src=\"img/pdf.png\" />سياسة الاستثمار</a></p>\r\n	</li>\r\n</ul>\r\n\r\n<h2>اللوائح و النظم</h2>\r\n\r\n<ul>\r\n	<li>\r\n	<p><a href=\"regulations/donations.pdf\"><img alt=\"\" src=\"img/pdf.png\" />جمع التبرعات</a></p>\r\n	</li>\r\n	<li>\r\n	<p><a href=\"regulations/donation-transfer.pdf\"><img alt=\"\" src=\"img/pdf.png\" />توجيه مبلغ التبرع إلى مشروع آخر</a></p>\r\n	</li>\r\n	<li>\r\n	<p><a href=\"regulations/conflict-of-interest.pdf\"><img alt=\"\" src=\"img/pdf.png\" />تعارض المصالح</a></p>\r\n	</li>\r\n</ul>\r\n\r\n<h2>التقارير و الإداريات</h2>\r\n\r\n<ul>\r\n	<li>\r\n	<p><a href=\"reports/financial-procedures.pdf\"><img alt=\"\" src=\"img/pdf.png\" />دليل الإجراءات المالية</a></p>\r\n	</li>\r\n	<li>\r\n	<p><a href=\"reports/financial-policies.pdf\"><img alt=\"\" src=\"img/pdf.png\" />دليل السياسات والإجراءات المالية والمحاسبية</a></p>\r\n	</li>\r\n	<li>\r\n	<p><a href=\"reports/anti-money-laundering.pdf\"><img alt=\"\" src=\"img/pdf.png\" />دليل المؤشرات الدالة وإجراءات عمليات غسيل الأموال وتمويل الإرهاب</a></p>\r\n	</li>\r\n	<li>\r\n	<p><a href=\"reports/financial-statements-2024.pdf\"><img alt=\"\" src=\"img/pdf.png\" />القوائم المالية لعام 2024م</a></p>\r\n	</li>\r\n</ul>', 'about', NULL, NULL, NULL, '2025-05-28 09:28:51', '2025-05-28 09:46:36');
